import React,{useState,useEffect} from 'react';


export default function InvestorCard({imageURL,href,alt}){

  //custom styling 
  const style={
    card:{
        minHeight:'175px',
        maxWidth:"350px",
        border:'none',
        margin:'20px 0px'
    }
  }


    return(
        <div className="col-xs-6 col-sm-6 col-md-6 col-lg-6 ">

        <div style={style.card} className='card  bg-white  pt-2 pb-2 pl-4 pr-4 d-flex flex-column justify-content-center  border border-light rounded bg-white shadow-lg '>

        <a href={href}>
            <img 
              src={imageURL} 
              className="card-img-top img-rounded h-100"
              alt={alt}
            />
        </a>

        </div>
  </div>
    )
}
